import { Post } from "@photo-service/contracts";
import { useQuery } from "react-apollo-hooks";
import { Loader } from "src/components/Loader";
import { PostItem } from "src/components/PostItem";
import { GET_FEED } from "./Feed.queries";
import { Container } from "./Feed.styled";

export const Feed: React.FC = () => {
  const { data, loading } = useQuery<{ getFeed: Array<Post> }>(GET_FEED);

  console.log(data);

  return (
    <Container>
      {loading && <Loader></Loader>}
      {!loading &&
        data?.getFeed &&
        data.getFeed.map((post) => (
          <PostItem key={post.id} {...post}></PostItem>
        ))}
    </Container>
  );
};
